import React from 'react';
import CartIcon from '../svg/shopping-cart-solid.svg'
import  Search from '../svg/search-solid.svg'
import Star from '../svg/star-solid.svg'
import {Link} from 'react-router-dom'
//import '../CSS/Header.css'
export default function Header(props) {
  const countCartItems=props       //--> 17
  return (
    <header className="block row right">


      <header>
           <nav>
           <div className="nav-star ">
                        <span></span>
                        <a to="/star">
                            <img src={Star} alt="" width="30"/>
                        </a>
                    </div>



                    <div className="nav-cart">
                        {/*<span >{cart.length}</span>*/}
                        <a href="#/cart">                                   {/*  17 */}
                            <img src={CartIcon} alt="" width="30"/>{' '}
                                {props.countCartItems ? (
                           <button className="badge">{props.countCartItems}</button>
                             ) : (
                              ''
                              )}
                        </a>{' '}
                    </div>
                    <div className="nav-search ">
                        <span></span>
                        <a to="/search">
                            <img src={Search} alt="" width="30"/>
                        </a>
                    </div>
           </nav>
        </header>                   



    </header>
  );
}
